import React from "react";
import { Routes, Route } from "react-router-dom";
import Login from "../../screens/Login/Login";

const PublicRoute = () => {
  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="/" element={<Login />} />
    </Routes>
  );
};

export default PublicRoute;
